import { useState } from 'react';
import createHook from '../component/index-predicate';

const useSpinner = createHook(useState, 0);

const Logo = ({ v }) => {
  return <img src="/static/logo.svg" />;
};

export default () => (
  <table>
    <tbody>
      <tr>
        {Array.from({ length: 20 }).map((_, i) => (
          <td key={i}>
            <Logo />
          </td>
        ))}
      </tr>
    </tbody>
  </table>
);
